import React from 'react';
import MyButton from "../../UI/button/MyButton";
import AddText from "./AddText";

const Text = () => {
    return (
        <div className="text">
            <div className="wrapper">
                <div className="text_item">
                    <MyButton onClick={async()=>{
                        await AddText();

                    }}>
                        GeT Posts
                    </MyButton>

                </div>
            </div>

        </div>
    );
};

export default Text;
